-- ----------------------------
-- View structure for `invoice`
-- ----------------------------
DROP VIEW IF EXISTS `invoice`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `invoice` AS select `users`.`name` AS `name`,`users`.`color` AS `color`,`sales`.`id` AS `id`,`sales`.`date_sale` AS `date_sale`,`products`.`product` AS `product`,`sales_items`.`commission` AS `commission`,`sales_items`.`retail` AS `retail`,`sales_items`.`quantity` AS `quantity`,round((`sales_items`.`retail` * `sales_items`.`quantity`),2) AS `TotalAmount`,round((`sales_items`.`commission` * `sales_items`.`quantity`),2) AS `TotalCommission`,`taxes`.`tax` AS `tax`,ifnull(`taxes`.`amount`,0) AS `tax_charges`,round((round((`sales_items`.`retail` * `sales_items`.`quantity`),2) * (ifnull(`taxes`.`amount`,0) / 100)),2) AS `TotalTax`,(round((`sales_items`.`retail` * `sales_items`.`quantity`),2) + round((round((`sales_items`.`retail` * `sales_items`.`quantity`),2) * (ifnull(`taxes`.`amount`,0) / 100)),2)) AS `GrandTotal`,ifnull(`banks`.`bank`,'NoBank') AS `bank`,ifnull(`payments`.`date_payment`,'1970-01-01') AS `date_payment`,ifnull(`payments`.`amount`,0) AS `PaymentAmount`,`customers`.`client` AS `client`,`customers`.`client_phone` AS `client_phone`,`customers`.`client_email` AS `client_email`,`slip_numbers`.`tracking_number` AS `tracking_number` from ((((((((((`sales` join `sales_items` on((`sales_items`.`id_sales` = `sales`.`id`))) join `products` on((`sales_items`.`id_product` = `products`.`id`))) left join `users` on((`sales`.`id_user` = `users`.`id`))) left join `sales_taxes` on((`sales_taxes`.`id_sales` = `sales`.`id`))) left join `taxes` on((`taxes`.`id` = `sales_taxes`.`id_tax`))) left join `payments` on((`payments`.`id_sales` = `sales`.`id`))) left join `banks` on((`banks`.`id` = `payments`.`id_bank`))) left join `sales_customers` on((`sales_customers`.`id_sales` = `sales`.`id`))) left join `customers` on((`customers`.`id` = `sales_customers`.`id_customer`))) join `slip_numbers` on((`slip_numbers`.`id_sales` = `sales`.`id`))) where (isnull(`sales`.`deleted_at`) and isnull(`sales_items`.`deleted_at`) and isnull(`payments`.`deleted_at`) and isnull(`sales_taxes`.`deleted_at`) and isnull(`sales_customers`.`deleted_at`) and isnull(`slip_numbers`.`deleted_at`));
